import React from 'react'
import { CloseIcon, DropdownContainer, Icon, DropdownWrapper, DropdownMenu, DropdownLink, DropdownBtnWrap} from './dropdownElements';

export const Dropdown = (toggle, isOpen) => {
    return (
        <DropdownContainer isOpen={isOpen} onClick={toggle}>
            <Icon>
                <CloseIcon />
            </Icon>
            <DropdownWrapper>
                <DropdownMenu>
                    <DropdownLink to="/"> Home</DropdownLink>
                    <DropdownLink to="/about">About</DropdownLink>
                    <DropdownLink to="/portfolio">Portfolio</DropdownLink>
                    <DropdownLink to="/contact">Contact</DropdownLink>
                    <DropdownLink to="/services">Services</DropdownLink>
                </DropdownMenu>
                <DropdownBtnWrap>

                </DropdownBtnWrap>
            </DropdownWrapper>

        </DropdownContainer>
    );
};

export default Dropdown;
